import './App.css';
import Row from './Row';
import request from './request';
import './Row.css'

function App() {
  return (
    <div className="App">
      <h2>Netflix Clone <small>/prateek</small></h2>

      <Row title = "NETFLIX ORIGNALS" fetchUrl = {request.fetchNetflixOrignals} />
      <Row title = "Trending now" fetchUrl = {request.fetchTrending} />
      <Row title = "Trending now" fetchUrl = {request.fetchToprated} />
      <Row title = "Trending now" fetchUrl = {request.fetchTrending} />
      <Row title = "Trending now" fetchUrl = {request.fetchTrending} />
      <Row title = "Trending now" fetchUrl = {request.fetchTrending} />
      <Row title = "Trending now" fetchUrl = {request.fetchTrending} />
      <Row title = "Trending now" fetchUrl = {request.fetchTrending} />
    </div>
  );
}

export default App;
